import React from 'react';

import './filteringAndSorting.css';

const FilteringAndSorting = () => {

    return (
        <div id='filter-sorting-container'>

            <div id='flex-container'>

            </div>
            <details>
                <summary>type</summary>
                <div>
                    game: <input type="checkbox" value="game" />
                    <br />
                        dlc: <input type="checkbox" value="dlc" />
                     <br />
                        bundle: <input type="checkbox" value="bundle" />
                </div>
            </details>
           
        </div>
    )

}

export default FilteringAndSorting;
